    <div className='hero-container'>
       <div>
        <h1>FIELD OF HOPE</h1>
        <h3>BUILDING RESILIENCE</h3>
       </div>
       <Button>DONATE</Button>

     <div>
       <p>Empower a women.</p>
       <p>Equip</p>
     </div>
    </div>
  );
}

export default HeroSection;
